package JavaPractice;

public class multiDimentionalArray {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		int a[][]= { {1,2,3},{4,5,6} };
		
		for(int i=0;i<2;i++)	//Row
			
		{
			
			for(int j=0; j<3;j++) //Column
			{
				
				System.out.println(a[i][j]);
		
			}
		}
		
	}
	
	
}
		
		

	
		


